import React from "react";

const NavBarItem = (props) => {
  const data = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  const navBarItem = data.map((item) => {
    return <li>{item.type}</li>;
  });

  return (
    <ul>
      <navBarItem></navBarItem>
    </ul>
  );
};

export default NavBarItem;
